  \"2013-03-19T00:31:06.515064\",\n\t\"name\": \"coastal-hazard-field-investigations-in-response-to-the-november-2011-bering-sea-storm-norton-so\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"On November 8, 2011, an extra-tropical
  cyclone with a low pressure of 945 millibars developed over the Bering Sea and moved
  northeast across the western coast of Alaska. This large storm brought high winds
  (gusts of up to 85 mph) to the entire region and a storm surge of approximately
  3 to 4 meters to parts of Norton Sound. The storm caused extensive flooding in the
  lower portion of Golovin on the afternoon of November 9, 2011. A team of Alaska
  Division of Geological & Geophysical Surveys (DGGS) scientists visited Golovin on
  November 15, 2011, to document peak water levels, runup elevations, and inundation
  extents caused by this event. These data were combined with photographs taken by
  local residents during the event and elevation data from the 2004 DCCED Community
  Map to generate inundation limit lines.\",\n\t\"license_title\": null,\n\t\"extras\":
